        "Sofa/Love Seat Spec",
        "2 room min",
        "Sectional",
        "Recliner",
        "Stairs",
        "Hallway"
    ]

    return (
        <div>
<Form>
  <Form.Group controlId="exampleForm.SelectCustom">
    <Form.Label>Custom select</Form.Label>
    <Form.Control as="select" custom>
        {products.map(()=>{
            return (
      <option>{products}</option>
        )})}
    </Form.Control>
  </Form.Group>
</Form>
</div>
    )
}

